short rgbconv(int r, int g, int b) {
    short color = ((r & 0x1F) << 11) | ((g & 0x3F) << 5) | (b & 0x1F);
    return color;
}
volatile int* audio_dev = (int*) 0xff203040; 

void play_note(int freq, int duration) {
    int counter;
    int status_reg;
    int sample_value = 0x7fffffff;
    duration = duration * 100;
    while (duration--) {
        // Wait for available write space
        do {
            status_reg = *((volatile int *)(audio_dev + 1));
        } while ((status_reg & 0xff00) == 0 || (status_reg & 0xff) == 0);

        // Write two audio samples
        counter = freq;
        while (counter--) {
            *((volatile int *)(audio_dev + 2)) = sample_value;
            *((volatile int *)(audio_dev + 3)) = sample_value;
        }

        // Invert waveform
        sample_value = ~sample_value + 1;
    }
}
void displayMovesCount(int moves, int y) {
    // Convert moves count to a string
    char movesStr[10];
    sprintf(movesStr, "%d", moves);

    // Calculate starting X position for displaying moves count (top right corner)
    int startX = 320 - (strlen(movesStr) * 8); // Assuming each character is 8 pixels wide

    // Clear the area where moves count will be displayed
    for (int i = startX; i < 320; i++) {
        for (int j = 0; j < 16; j++) { // Assuming a character height of 16 pixels
            write_char(i, j, ' '); // Clear character space
        }
    }

    // Display moves count string starting from calculated position
    char mo[] = "Number of moves made: ";
    writeString(26, y, mo);
    writeString(50, y, movesStr);
}

char get_jtag(volatile int *JTAG_UART_ptr)
{
    int data;
    data = *(JTAG_UART_ptr);
    if (data & 0x00008000) // check RVALID
        return ((char)data & 0xFF);
    else
        return ('\0');
}

void put_jtag(volatile int *JTAG_UART_ptr, char c)
{
    int control;
    control = *(JTAG_UART_ptr + 1); // read control reg
    if (control & 0xFFFF0000)
    {
        *(JTAG_UART_ptr) = c;
    }
}

void writeString(int x, int y, char s[])
{
    int i;
    for ( i = 0; i < strlen(s); i++)
    {
        write_char(x, y, s[i]);
        x++;
    }
}

void homeScreen()
{
    volatile int *JTAG_UART_ptr = (int *)JTAG_UART_BASE;
    char c;
    int x,y;
    for (x = 0; x < 80; x++)
    {
        for (y = 0; y < 60; y++)
        {
            write_char(x, y, (char)0);
        }
    }
    //clear_screen();
    renderImage();
    
    char h3[] = "Press TAB to read RULES of the game";
    writeString(24, 57, h3);
    char h2[] = "Press ENTER to start";
    writeString(28, 55, h2);
    char h4[] = "Choose the number of disks: (3, 4, or 5)";
    writeString(24, 59, h4);
    while (1) {
        // Check user input for the number of disks
        c = get_jtag(JTAG_UART_ptr);
        if (c >= '3' && c <= '5') {
            DISKS = c - '0'; // Convert char to int
            break;
        }
    }
    while (1)
    {
        c = get_jtag(JTAG_UART_ptr);
        if (c == 0x0a)
        {
            clear_screen();
            game();

            break;
        }
        if (c == 0x09)
        {
            clear_screen;
            rules();

            break;
        }
    }
}

